import HealthyHome from '../../../public/HealthyHome.svg';

const Home = () => (
  <>
  <TextContainer>
    Zombies
  </TextContainer>
  <div>
    <img src={HealthyHome} alt="Healthy Home" />
  </div>
  </>
)

export default Home;
